  return axios.get(`${config.serverUrl}/api/contests`).then((resp) => {
    return {
      initialMarkup: ReactDOMServer.renderToString(
        <App initialContest={resp.data.contests} />
      ),
      initialData: resp.data,
    };
  });
};
export default serverRender;

